 To implement a queue using two stacks in Python, we'll use the following principles:

- **Stack 1 (queue)**: This stack will hold the elements in the order they are enqueued.
- **Stack 2 (temp)**: This stack will be used to temporarily store the elements from Stack 1 and maintain the FIFO (First-In-First-Out) order.

### Queue Class

```python
class Queue:
    def __init__(self):
        self.stack1 = []
        self.stack2 = []

    def enqueue(self, item):
        """Add an item to the queue."""
        self.stack1.append(item)

    def dequeue(self):
        """Remove an item from the queue."""
        if not self.stack2:
            while self.stack1:
                self.stack2.append(self.stack1.pop())
        return self.stack2.pop()

    def peek(self):
        """Return the front item of the queue without removing it."""
        if not self.stack2:
            while self.stack1:
                self.stack2.append(self.stack1.pop())
        return self.stack2[-1]

    def is_empty(self):
        """Check if the queue is empty."""
        return not bool(self.stack1) and not bool(self.stack2)
```

### Example Usage

```python
queue = Queue()
queue.enqueue(1)
queue.enqueue(2)
queue.enqueue(3)

print(queue.peek())  # Output: 1
print(queue.dequeue())  # Output: 1
print(queue.peek())  # Output: 2
```

This implementation ensures that the queue follows the FIFO principle, even though it is implemented using two stacks.

 To find common elements in two arrays without using extra data structures, we can use a single loop and compare elements directly. Here's a Python solution:

### Python Solution

```python
def find_common_elements(arr1, arr2):
    common_elements = set()

    # Iterate through the first array
    for num in arr1:
        # If the number is in the second array, add it to the result
        if num in arr2 and num not in common_elements:
            common_elements.add(num)

    return sorted(common_elements)

# Test the function
arr1 = [1, 2, 3, 4, 5, 6]
arr2 = [4, 5, 6, 7, 8, 9]
print(find_common_elements(arr1, arr2))  # Output: [4, 5, 6]
```

This solution uses a set to store the common elements and sorts the result at the end. The time complexity of this solution is O(n + m), where n and m are the lengths of the input arrays.

### C++ Solution

```cpp
#include <iostream>
#include <vector>
#include <algorithm>

std::vector<int> find_common_elements(const std::vector<int>& arr1, const std::vector<int>& arr2) {
    std::vector<int> common_elements;

    // Iterate through the first array
    for (const auto& num : arr1) {
        // If the number is in the second array, add it to the result
        if (std::find(arr2.begin(), arr2.end(), num) != arr2.end() && std::find(common_elements.begin(), common_elements.end(), num) == common_elements.end()) {
            common_elements.push_back(num);
        }
    }

    std::sort(common_elements.begin(), common_elements.end());
    return common_elements;
}

// Test the function
int main() {
    std::vector<int> arr1 = {1, 2, 3, 4, 5, 6};
    std::vector<int> arr2 = {4, 5, 6, 7, 8, 9};
    auto common_elements = find_common_elements(arr1, arr2);
    for (const auto& num : common_elements) {
        std::cout << num << " ";
    }
    std::cout << std::endl;  // Output: 4 5 6
    return 0;
}
```

This C++ solution uses the `std::find` function to check if an element is in the array and the `std::vector::push_back` function to add elements to the result vector. The time complexity of this solution is O(n + m), where n and m are the lengths of the input arrays.
